// src/pages/BreakingNewsPage.jsx
import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import NewsCard from '../components/NewsCard';
import VideoModal from '../components/VideoModal';
import { fetchAllContent } from '../services/contentService';
import '../styles/CategoryPage.css';

const BreakingNewsPage = () => {
  const [content, setContent] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedVideo, setSelectedVideo] = useState(null);
  const [selectedBorough, setSelectedBorough] = useState('All');

  const boroughs = ['All', 'Manhattan', 'Brooklyn', 'Queens', 'Bronx', 'Staten Island'];

  useEffect(() => {
    const loadBreakingNews = async () => {
      try {
        setLoading(true);
        const query = selectedBorough === 'All' 
          ? 'New York breaking news urgent' 
          : `${selectedBorough} New York breaking news`;

        const data = await fetchAllContent({
          query,
          includeVideos: false,
          includeArticles: true
        });

        // Sort by most recent
        const sortedData = data.sort((a, b) => 
          new Date(b.publishedAt) - new Date(a.publishedAt)
        );

        setContent(sortedData);
      } catch (err) {
        console.error('Error loading breaking news:', err);
      } finally {
        setLoading(false);
      }
    };

    loadBreakingNews();
  }, [selectedBorough]);

  const handleVideoClick = (video) => {
    setSelectedVideo(video);
  };

  const handleCloseModal = () => {
    setSelectedVideo(null);
  };

  return (
    <div className="category-page">
      {/* Hero Section */}
      <motion.div 
        className="category-hero breaking-news-hero"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.6 }}
      >
        <div className="page-container">
          <div className="category-hero-content">
            <motion.div
              className="breaking-badge"
              initial={{ scale: 0 }}
              animate={{ scale: 1 }}
              transition={{ delay: 0.2, type: 'spring' }}
            >
              üö® LIVE
            </motion.div>
            <motion.h1 
              className="category-title"
              initial={{ y: 30, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ delay: 0.3, duration: 0.6 }}
            >
              Breaking News
            </motion.h1>
            <motion.p 
              className="category-description"
              initial={{ y: 30, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ delay: 0.4, duration: 0.6 }}
            >
              Stay informed with the latest urgent news and updates from across NYC
            </motion.p>
          </div>
        </div>
      </motion.div>

      <div className="page-container">
        {/* Borough Filter */}
        <div className="filter-section">
          <h3 className="filter-label">Filter by Borough:</h3>
          <div className="borough-filters">
            {boroughs.map((borough) => (
              <button
                key={borough}
                className={`filter-btn ${selectedBorough === borough ? 'active' : ''}`}
                onClick={() => setSelectedBorough(borough)}
              >
                {borough}
              </button>
            ))}
          </div>
        </div>

        {/* Content Stats */}
        <div className="content-stats">
          <p>
            <span className="live-indicator">‚óè</span>
            {content.length} breaking stories
            {selectedBorough !== 'All' && ` in ${selectedBorough}`}
          </p>
        </div>

        {/* News Feed */}
        {loading ? (
          <div className="feed-loading">
            <div className="spinner"></div>
            <p>Loading breaking news...</p>
          </div>
        ) : (
          <div className="feed-grid">
            {content.length > 0 ? (
              content.map((item) => (
                <NewsCard 
                  key={item.id} 
                  content={item}
                  onVideoClick={handleVideoClick}
                />
              ))
            ) : (
              <div className="feed-empty">
                <p>No breaking news available at the moment.</p>
              </div>
            )}
          </div>
        )}
      </div>

      {/* Video Modal */}
      {selectedVideo && (
        <VideoModal 
          video={selectedVideo} 
          onClose={handleCloseModal} 
        />
      )}
    </div>
  );
};

export default BreakingNewsPage;
